import React from "react";
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

function Form(){
    const notify = () => toast("Wow so easy!");

    return (
        <div>
            <form className="number-form" action="/" method="post">

                <input type="text" name="phoneNumber" placeholder="phone number" required="True"/>
                <input type="submit" value="submit"/>

            </form>

            <form className="code-form" action="/validate" method="post">

                <input type="text" name="accessCode" placeholder="access code"/>  
                <input type="submit" onClick={notify} value="validate"/>
                <ToastContainer />

            </form>
        </div>
    )


}

export default Form
